import React from "react";
import "./Services.css";

export default function Services() {
  return (
    <div className="service">
      <p className="s-head">Services</p>
      <div className="services">
        <div className="ser">
          <p>SPA app</p>
        </div>
        <div className="ser">
          <p>Maintenance Support</p>
        </div>
        <div className="ser">
          <p>API Integration</p>
        </div>
      </div>
    </div>
  );
}
